


create table Cars (
	Id INT PRIMARY KEY IDENTITY(1,1),
	Car_Make NVARCHAR(255),
	Model NVARCHAR(255),
	[Year] DATE,
	VIN NVARCHAR(255),
	Color NVARCHAR(255),
	Price MONEY,
	Engine_Size DECIMAL(4,1),
	Country NVARCHAR(255),
	Milage INT,
	Consumption DECIMAL(3,1)
);


CREATE TABLE Expensive_Cars (
	Id INT PRIMARY KEY IDENTITY(1,1),
	Car_Make NVARCHAR(255),
	Model NVARCHAR(255),
	VIN NVARCHAR(255),
	Color NVARCHAR(255),
	Price MONEY,
);

DROP TABLE Expensive_Cars

SELECT * FROM Cars 
WHERE VIN LIKE '1%'

SELECT * FROM Cars 
WHERE VIN LIKE '%1'

SELECT * FROM Cars 
WHERE VIN LIKE '_C%'

SELECT * FROM Cars 
WHERE VIN LIKE '[^A-E]%'


SELECT * FROM Cars 
WHERE VIN LIKE '_[A-D]%'

