DECLARE @i INT;
SET @i = 0;

WHILE @i < 10
BEGIN
	IF @i%2 <> 0
	BEGIN
	PRINT @i;
	END

	SET @i = @i + 1;
END

DECLARE @num INT = 0;

DECLARE @res NVARCHAR(255) =
CASE
WHEN @num = 0 THEN 'zero'
WHEN @num = 1 THEN 'one'
END

