SELECT * FROM Expensive_Cars


SELECT c.Car_Make + ' ' + c.Model AS 'Make Model', c.VIN, c.Color, c.Price
INTO Expensive_Cars
FROM Cars AS c
WHERE c.Price > 50000;

SELECT * FROM Cars;

SELECT c.Car_Make + ' ' + c.Model AS 'Car Info' FROM Cars AS c;


SELECT c.Car_Make + ' ' + c.Model AS 'Car Info',c.Color, c.Price 
FROM Cars AS c
ORDER BY c.Price DESC



